import React from "react";
import {
  SidebarContainer,
  Icon,
  CloseIcon,
  SidebarRoute,
  SideBtnWrap,
} from "./SidebarElement";

const Sidebar = (props, {isOpen, toggle}) => {

  const {cart} = props;

  console.log(cart)

  return (
    <SidebarContainer isOpen={isOpen} onClick={toggle}>
      <Icon>
        <CloseIcon />
      </Icon>
      {cart.map((prod, index) => {
        return (
          <div>
            <h1>{prod.name}</h1>
            <h2>{prod.quantity}</h2>  
          </div>
        )
      })}
      <SideBtnWrap>
        <SidebarRoute to="/">Order Now</SidebarRoute>
      </SideBtnWrap>
    </SidebarContainer>
  );
};

export default Sidebar;
